import React, { useState } from 'react';
import { Button, TextField, Typography, Paper } from '@material-ui/core';

import useStyles from './styles.js';

const Form = () => {
    const [postData, setPostData] = useState({
        creator: '',
        location: '',
        comment: '',
        buddies: '',
        tags: '',
        maxDepth: '',
        duration: '',
        selectedFile: '' 
    });
    const classes = useStyles();

    const handleSubmit = () => {

    }
    
    return (
        <Paper className={classes.paper}>
            <form autoComplete='off' 
            noValidate 
            className={classes.form} 
            onSubmit={handleSubmit}>
                <Typography variant='h6'>Create a new Log!</Typography>
                <TextField 
                name='creator' 
                variant='outlined' 
                label='Creator' 
                fullWidth
                value={postData.creator}
                onChange={(e) => setPostData({
                    ...postData, creator: e.target.value
                })}/>
                <TextField 
                name='location' 
                variant='outlined' 
                label='Location' 
                fullWidth
                value={postData.location}
                onChange={(e) => setPostData({
                    ...postData, location: e.target.value
                })}/>
                <TextField 
                name='comment' 
                variant='outlined' 
                label='Comment' 
                fullWidth
                value={postData.comment}
                onChange={(e) => setPostData({
                    ...postData, comment: e.target.value
                })}/>
                <TextField 
                name='maxDepth' 
                variant='outlined' 
                label='Maximum Depth' 
                fullWidth
                value={postData.maxDepth}
                onChange={(e) => setPostData({
                    ...postData, maxDepth: e.target.value
                })}/>
                <TextField 
                name='duration' 
                variant='outlined' 
                label='Duration' 
                fullWidth
                value={postData.duration}
                onChange={(e) => setPostData({
                    ...postData, duration: e.target.value
                })}/>
            </form>
        </Paper>
    )
}

export default Form;
